import logo from './logo.svg';
import './App.css';

function Title() {
  return (
    <header>
      <h1>David Strupinski</h1>
    </header>
  )
}

function AboutMe() {
  return (
    <div>
      <h1>About Me</h1>
      <img src='logo.svg'></img>
      <p>Placeholder text</p>
    </div>
  )
}

function App() {
  return (
    <div className='App'>
      <Title />
    </div>
  );
}

export default App;
